import * as Action from '../redux/result_reducer'


export const PushAnswer = (result) => async (dispatch)=> {
    try{
        await dispatch(Action.pushresultAction(result))
    }catch (error) {
        console.log(error)
    }
}
export const updateresult ={ index,checked}
